import React from 'react';
import './App.css';
import Navbar from 'react-bootstrap/Navbar'

function App() {
  return (
    <div>
     <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home">Ivan Andi's Portofolio</Navbar.Brand>
     </Navbar>
    </div>
  );
}

export default App;
